import {
    Center,
    Text,
    Heading,
    VStack,
    Button,
    Input,
    HStack,
    Container,
    SimpleGrid,
    Box,
    Image,
    Spinner,
} from "@chakra-ui/react";

import { useState, useEffect } from "react";
import { ChakraProvider } from "@chakra-ui/react";

function App() {
    return (
        <ChakraProvider>
            <Center bg="black" color="white" padding={8}>
                <VStack>
                    <Heading> Votre galerie vidéos</Heading>
                    <Text></Text>
                </VStack>
            </Center>
            <p>Hello World</p>
        </ChakraProvider>
    );
}

export default App;
